import React, { Component } from "react";
import store from "../api";

export default class MainPage extends Component {
  getStoreData = async () => {
    const storeData = await store.get("/storeItems");
    console.log(storeData);
  };

  deleteItem = async () => {
    store.delete("/storeItems/2");
  };
  componentDidMount() {
    this.getStoreData();
  }

  render() {
    return (
      <div>
        <h1>Welcome to my site</h1>
      </div>
    );
  }
}
